import React, { Component } from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Typography from '@material-ui/core/Typography';

const styles = theme => ({
  container: {
    height: '100vh',
    margin: '10px auto',
    width: '50%',
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'center',
    alignContent: 'center',
    textAlign: 'center',
    background: '-webkit-linear-gradient(270deg, rgba(153,186,87,1) 0%, rgba(230,240,225,1) 100%, rgba(230,240,225,1) 100%)',
  },
  root: {
    maxWidth: '100%',
    flexGrow: 1,
    marginTop: '80px',
  },
  containerHeader: {
    display: 'flex',
    padding: '0 8px',
    alignItems: 'center',
    justifyContent: 'space-between',
    marginBottom: '16px',
    color: 'white !important',
    fontWeight: 'none',
  },
  txtError: {

  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
  flex:'auto',
  },
});

class error404 extends Component {

  render(){
    const { classes } = this.props;

    return(
      <div>
      <div className={classes.container}>
        <Typography component="h1" variant="h6" color="inherit"  className={classes.txtError} >
        Â¿Como te llamas?
        </Typography>
        <Typography component="h5" variant="h5" color="inherit"  className={classes.txtError} >
        Ingresa tu nombre y correo electronico
        </Typography>
      </div>
      </div>
      );
  }
}
error404.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(error404);
